children.value:
.sponsor-section {
    padding-top: calc(var(--size-1000) * var(--pad, 1));
    --background: linear-gradient(to bottom, var(--color-tan) 0%, #E8ADB7 100%);
}
.title {
    text-align: center;
    margin-bottom: 4rem;
}
.sponsors a {
    display: inline-block;
    position: relative;
    z-index: 1;
    color: black;
}
.sponsors a > span {
    display: inline-block;
}
.sponsors a > span > svg {
    pointer-events: none;
}
.sponsors + .sponsors {
    margin-top: 2.5rem;
}
.cta {
    font-family: var(--font-display);
    text-align: center;
    color: var(--color-dusk);
    margin-top: 2rem;
}
ul.individuals {
    list-style: none;
    display: flex;
    flex-flow: row wrap;
    align-items: center;
    justify-content: center;
    gap: 0.5rem;
    max-width: 40rem;
}
.individuals > li {
    box-sizing: border-box;
    border: 0.25rem solid rgba(255, 255, 255, 0);
}
.individual {
    position: relative;
    --size: 3rem;
    width: var(--size);
    height: var(--size);
    border-radius: 50%;
    overflow: hidden;
    display: flex;
    flex-direction: column;
}
.individual img {
    pointer-events: none;
    position: relative;
    width: var(--size);
    height: var(--size);
    aspect-ratio: 1 / 1;
    background: var(--color-white);
    display: flex;
    align-items: center;
    justify-content: center;
    overflow: hidden;
}
.individual span::before {
    content: "";
    content: attr(data-initials);
    position: absolute;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
    z-index: 0;
    background: var(--color-dusk);
    color: var(--color-white);
    font-family: var(--font-display);
    font-size: 1.25rem;
    display: flex;
    align-items: center;
    justify-content: center;
    text-align: center;
}
.individual img:not([src]) {
    display: none;
}

.sponsors {
    margin: 0 auto;
    padding: 0;
    max-width: max-content;
    list-style: none;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-flow: row wrap;
    gap: 1.5rem;
    color: var(--color-dusk);
}

@media (min-width: 52rem) {
    .sponsors {
        grid-auto-flow: column;
        max-width: max-content;
        margin: 0 auto;
        gap: 2rem;
        grid-template-columns: repeat(auto-fit, minmax(0, 1fr));
    }
}
@media (min-width: 64rem) {
    .sponsors {
        gap: 4rem;
    }
}
.sponsors > li {
    display: flex;
    align-items: center;
    justify-content: center;
    text-align: center;
}

